import { Link } from "react-router-native";
import ListItem from "../components/list-item";

const categories = [
    "Hombros",
    "Triceps",
    "Biceps",
    "Pectoral",
    "Espalda",
    "Piernas",
    "Abdominales"
];

const Categories = () => {
    return (<>
        {categories.map((category, index) =>
            <ListItem
                key={`category-${index}`}
                text={category}
                url={`/categories/${category}/exercises`}
            />
        )}
    </>);
}

export default Categories;
